import help from '../../assets/carousel/help.jpg';
import 'bootstrap/dist/css/bootstrap.css';
import './index.css';

function carousel() {
  return (
      <Carousel fade controls={false}>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={help}
            alt="Third slide"
          />

          {/* <Carousel.Caption>
            <h3>Third slide label</h3>
